import React from "react";
import { motion } from "framer-motion";
import { useNavigate } from "react-router-dom";

const ReviewsLeft = () => {
  const navigate = useNavigate();
  return (
    <motion.div
      initial={{ opacity: 0, y: 40 }}
      animate={{ opacity: 1, y: 0 }}
      transition={{ duration: 0.5 }}
      className="w-full max-w-xl mx-auto mt-8 sm:mt-16 bg-white/90 rounded-2xl shadow-2xl px-4 py-6 sm:p-10"
    >
      <button
        className="mb-4 sm:mb-6 text-green-700 text-sm sm:text-base font-semibold hover:underline flex items-center gap-1"
        onClick={() => navigate(-1)}
        aria-label="Back to Profile"
      >
        <span className="text-lg">&larr;</span> Back
      </button>
      <h2 className="text-xl sm:text-2xl font-bold mb-4 sm:mb-6 text-green-800">Reviews Left</h2>
      <p className="text-gray-600 mb-4">(User reviews UI coming soon...)</p>
    </motion.div>
  );
};

export default ReviewsLeft;
